config = configparser.ConfigParser()
config.read('userbot.cfg', "utf-8")
prefix_userbot = config['HACK337_USERBOT']['prefix_userbot'].split(',')
base64_str = ""


def gen_api(user, i):
    try:
        res = requests.post('http://api.onlysq.ru/ai/v2', json={"model": "nsfw-xl", "request": {'messages': [{"role": "user", "content": user+","*i}], "meta": {"type": 0}}})
        return res.json()['answer']
    except Exception as e:
        return str(e)

def generate_images_concurrently(user, num_images=4):
    with concurrent.futures.ThreadPoolExecutor(max_workers=num_images) as executor:
        futures = [executor.submit(gen_api, user, i) for i in range(num_images)]
        results = [future.result() for future in concurrent.futures.as_completed(futures)]
    return results

def register_commands(app):
    @app.on_message(filters.me & filters.command(["–Ω—Ö–ª","—Ç—á–¥", "nxl"], prefixes=prefix_userbot))
    async def nxl_module(client, message):
        if message.text.count(" ") > 0:
            user = message.text.split(" ",1)[1]
        else:
            await message.edit("Invalid arguments")
            return

        image_bytes = base64.b64decode(base64_str)
        load = BytesIO(image_bytes)
        load.name = "img.png"
        ms = await client.send_media_group(message.chat.id, [InputMediaPhoto(load),InputMediaPhoto(load),InputMediaPhoto(load),InputMediaPhoto(load)])
        await message.delete()
        files = generate_images_concurrently(user)
        for m, url in zip(ms, files):
            if url[0].startswith("https"):
                await client.edit_message_media( m.chat.id ,m.id, InputMediaPhoto(url[0]))
            else:
                await client.edit_message_media( m.chat.id ,m.id, InputMediaPhoto("https://i.imgur.com/rMFYuon.jpg"))

